(2) in addition to the requirements of Subsection (1) above, perform a Drug Screen on any Vendor Person whom Vendor proposes to have access to Customer Information, Systems, or Physical Entry onto AT&T's or its customers' premises, and not permit any such Vendor Person presenting a positive Drug Screen to have access to Customer Information, Systems, or Physical Entry onto AT&T's or its customers' premises.

The scope of AT&T Audits shall also include:
(i) practices and procedures used in performing the Services;
(ii) systems, communications and information technology used in performing the Services;
(iii) general controls and security practices and procedures;
(iv) supporting information and calculations regarding invoices and compliance with service requirements;
(v) quality initiatives and quality assurance; and
(vi) compliance with the terms of this Agreement.

The Agreement includes these terms and conditions and the documents referenced herein ("Base Terms"), e-business hosting services order forms accepted by IBM ("Order Forms"), and the following attachments:
a. Attachment A: Facilities Services;
b.

AT&T and its auditors (including internal audit staff and external auditors) and governmental authorities shall have the right to review such records ("AT&T Audits") held and created by Vendor, to verify the following:
(i) the accuracy of Vendor's invoices and AT&T's payment obligations hereunder;
(ii) that the Work charged for was actually performed;
(iii) that the Services have been and are being provided in accordance with this Agreement;
(iv) the integrity of Vendor's systems that process, store, support, maintain, and transmit AT&T data;
(v) Vendor's records relating to the performance of Vendor's Subcontractors with respect to any portion of the Services; and
(vi) that Vendor and its Subcontractors are complying with Section 3.6 hereof.
